import React from 'react';
import './App.css';


//a5o4wu2Ghgnehh_kX79193wPTv9bD4A72hY5mtzv
function App() {

    let result:Promise<JSON>= fetch("https://api.wheretheiss.at/v1/satellites/25544")
        .then(response => JSON.stringify())
        .then(result => console.log(result.name))
        .catch(error => console.log('error', error));

function getResult() {


    return (<div>
        {result.JSON.stringify}
        </div>)
}


  return (
    <div className="App">
          Here we go:
      <div >
          { getResult() }
            </div>

    </div>
  );
}

export default App;
